import execjs
import base64
from Crypto.Cipher import AES


def py_decrypt(text):
    key = 'm1x2!3p4$567890000000123456789@$'
    iv = '1234567890000000'
    cipher = AES.new(key, AES.MODE_CBC, iv)
    text = cipher.decrypt(base64.b16decode(text)).decode('utf-8')
    pad_num = ord(text[-1])
    return text[:-pad_num]

def js_decrypt(text):
    with open('decrypt.js', 'r') as f:
        ctx = execjs.compile(f.read())
        return ctx.call('decrypt', text)


if __name__ == '__main__':
    text = ''
    print(py_decrypt(text))
